INSERT INTO `courses` VALUES (1,'MS-OFFICE - INTRODUCTION (in telugu)','public/images/download_1599742296.jpg',3,'intermediate','eeeeeeeeeeeeeeeeee sdfds gdg dgdgdgdgd gdgdfg dfgdfgdfgd gdgdgdgdg','<p>Qui et explicabo voluptatem et ab qui vero et voluptas. Sint voluptates temporibus quam autem. Atque nostrum voluptatum laudantium a doloremque enim et ut dicta. Nostrum ducimus est iure minima totam doloribus nisi ullam deserunt. Corporis aut officiis sit nihil est. Labore aut sapiente aperiam. Qui voluptas qui vero ipsum ea voluptatem. Omnis et est. Voluptatem officia voluptatem adipisci et iusto provident doloremque consequatur. Quia et porro est. Et qui corrupti laudantium ipsa. </p><p><br></p>','2020-09-02 21:42:59','2020-09-10 07:21:36'),(2,'Health Masterclass: How To Transform Your Health & Life','public/images/1572276_dfee_3_1599742461.jpg',2,'beginner','fsdfsdfsdf','<p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">Because if you’re tired of following&nbsp;traditional advice...</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">And still&nbsp;<em style=\"margin: 0px; padding: 0px;\">don\'t&nbsp;</em>look how you\'d like to look, weigh&nbsp;what you\'d like to weigh or feel how you\'d like to feel...</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\"><strong style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">I Made This Course For You.</em></strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">After wondering why my family followed their doctor\'s advice but still had to take pills for the rest of their lives,&nbsp;I set out to find the answer.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">I read 31&nbsp;books on health and nutrition&nbsp;and boiled it ALL&nbsp;down into&nbsp;<em style=\"margin: 0px; padding: 0px;\">perhaps the most&nbsp;simple, straight to the point system you can use in your life today to transform your health and nutrition.</em></p>','2020-09-02 21:52:57','2020-09-10 07:30:07'),(3,'The Complete Communication Skills Master Class','public/images/1802404_48e9_2_1599742580.jpg',2,'beginner','5555555555555555','555555555555555555555555555555555555555','2020-09-03 10:21:45','2020-09-10 07:26:20'),(4,'Leadership: Practical Leadership Skills','public/images/613808_3c1c_6_1599742709.jpg',2,'beginner','dssf','<p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;SF Pro Text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">Leadership is often seen an elusive or complex skill, but with this practical course you\'ll soon have it mastered. Whether you\'re managing a small team or an entire business this course will build essential skills for your time management, team motivation, and personal happiness. Leadership is an essential skill at home, at work, and in every stage of your career. If you\'re in charge of two or more people at work, this course could change your life.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;SF Pro Text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\"><br style=\"margin: 0px; padding: 0px;\"></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;SF Pro Text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">Chris Croft is an international speaker, and widely published author, who\'s been teaching Leadership Skills to companies for over 20 years. He\'s taught all over the world, as well as online, and has an entertaining and practical teaching style. This course is guaranteed to keep you engaged and amused, and teach you life changing skills for home and work.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;SF Pro Text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\"><br style=\"margin: 0px; padding: 0px;\"></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;SF Pro Text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">This Leadership course covers everything you need to know from delegating and motivating, differing leadership styles, keeping your finger on the pulse, and planning the future of your business. It looks at lots of real life examples (some of which will definitely get you laughing) and gives practical tools you can use right away to get better results.</p>','2020-09-03 10:22:30','2020-09-10 07:28:29'),(5,'Operating Systems Fundamentals','public/images/865984_5353_1599742933.jpg',2,'beginner','fsdfsdf','<p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">This course is designed to prepare the student for the&nbsp;<em style=\"margin: 0px; padding: 0px;\">CompTIA 220-901&nbsp;&amp; 220-902</em>. Students will look into operating systems&nbsp;procedures. Once in our course review our course map to see just how we align&nbsp;with CompTIA\'s A+ Certification in providing this training.&nbsp;Learn the main exam objectives by learning these key concepts we cover:</p><ul style=\"margin: 0.8rem 0px 0px; padding: 0px 0px 0px 2.4rem; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\"><li style=\"margin: 0px; padding: 0px 0px 0px 0.8rem;\">Windows Operating Systems</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Troubleshooting PC OS</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Installing and Patching Windows OS</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Windows Command Line Tools</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Overview of Mac OS and Linux OS</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Cloud Computing and Virtualization</li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\">Server Roles and Threat Management</li></ul><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">Our lectures are paired with a variety of demonstrations and quizzes giving visual example and real world look of the concepts that will be talked about.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: &quot;sf pro text&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;segoe ui&quot;, Helvetica, Arial, sans-serif, &quot;apple color emoji&quot;, &quot;segoe ui emoji&quot;, &quot;segoe ui symbol&quot;;\">Our sections listed below are can be taken in any order, as a review of a particular concept or exam domain. However, if you are just becoming familiar with the&nbsp;operating systems&nbsp;it is recommended that you view the courses sequentially.</p>','2020-09-03 10:22:47','2020-09-10 07:32:13'),(6,'C Programming For Beginners - Master the C Language','public/images/1467808_f8c0_1599743288.jpg',2,'beginner','C language','<p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"SF Pro Text\", -apple-system, BlinkMacSystemFont, Roboto, \"Segoe UI\", Helvetica, Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\";\">C is often considered to be the mother of all languages because so many other languages have been based on it.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"SF Pro Text\", -apple-system, BlinkMacSystemFont, Roboto, \"Segoe UI\", Helvetica, Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\";\">Though C is simple it is one of the <strong style=\"margin: 0px; padding: 0px;\">most powerful languages ever created</strong>.  Considering it was created over 40 years ago, it is still used heavily and is usually in the top 5 or 10 most popular and most widely programming languages in the world.<br style=\"margin: 0px; padding: 0px;\"></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"SF Pro Text\", -apple-system, BlinkMacSystemFont, Roboto, \"Segoe UI\", Helvetica, Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\";\">Learning C can actually make you a better programming in other languages like C++, Java, or C# by equipping you with a mental model of what the computer is actually doing when you run your programs.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">By learning how things really work \"under the hood\", and understand memory space, CPU architecture and so on, you can create more efficient programs, and obtain a huge advantage over other programmers in the process.</p>','2020-09-10 07:37:48','2020-09-10 07:38:08');
