INSERT INTO `universities` VALUES (1,'Acharya Nagarjuna University','anu@ap.gov.in','http://anu.rnit.solutions.loc','+91 97435 43534','public/universites/1433251140gate_1599709855.jpg','ANU','Guntur, AP','<p><span style=\"color: rgb(38, 38, 38); font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\">Acharya Nagarjuna University mostly known as ANU was inaugurated on 11th September 1976. It is located in the Namburu, Guntur, Andhra Pradesh, India. ANU offers several post-graduate courses in different fields and some under-graduate courses.</span></p><p><span style=\"color: rgb(38, 38, 38); font-size: 1rem;\">Started with 10 post graduate courses, university is now expanded to 39 academic departments providing degree, diploma and distance learning in various subjects.</span><br></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38); font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\">The University has now completed 30 years and has 450 affiliated colleges. It strives to maintain high academic standards in consonance with quantitative increase in the number of students being enrolled every year. It has an eagle eye for teaching and research.</p><h3 style=\"font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(38,=\"\" 38,=\"\" 38);=\"\" margin-top:=\"\" 20px;=\"\" margin-bottom:=\"\" 10px;=\"\" font-size:=\"\" 16px=\"\" !important;\"=\"\">Acharya Nagarjuna University Overview</h3><div class=\"table-responsive\" style=\"overflow-y: hidden; width: 899.75px; color: rgb(38, 38, 38); font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\"><table class=\"table table-bordered\" style=\"border-spacing: 0px; width: 899px; max-width: 100%; margin-bottom: 20px; border-width: initial; border-style: none; font-weight: 600;\"><tbody style=\"color: rgb(76, 70, 70);\"><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Location</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">NH16, Nagarjuna Nagar, Guntur, Andhra Pradesh 522510</td></tr><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857;\">Type</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857;\">Autonomous funded by UGC</td></tr><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Accreditation</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">UGC and NAAC accredited</td></tr><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857;\">Courses Offered</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857;\">UG, PG, Diploma, Distance Learning</td></tr><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Ranking</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Ranked between 151-200 by MHRD in 2018</td></tr></tbody></table></div><hr style=\"border-top-color: rgb(238, 238, 238); margin-top: 20px; margin-bottom: 20px; color: rgb(38, 38, 38); font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\"><br><p><span style=\"color: rgb(38, 38, 38); font-family: din, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\"><br></span></p>','2020-08-29 14:19:00','2020-09-09 23:34:03','public/universites/25344_ANU_APP_1599638110.jpg','public/universites/anu_1599638110.jpg','<h1><span style=\"color: rgb(33, 37, 41); font-family: Montserrat, sans-serif; font-size: 16px;\">Education is not the filling of a pail, but the lighting of a fire.</span></h1>\r\n      <h2>Try to learn something about everything and everything about something.</h2>','<p><span style=\"color: rgb(38, 38, 38);\">Acharya Nagarjuna University mostly known as ANU was inaugurated on 11th September 1976. It is located in the Namburu, Guntur, Andhra Pradesh, India. ANU offers several post-graduate courses in different fields and some under-graduate courses.</span></p><p helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\" style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38);\">Started with 10 post graduate courses, university is now expanded to 39 academic departments providing degree, diploma and distance learning in various subjects.</p><p helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\" style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38);\">The University has now completed 30 years and has 450 affiliated colleges. It strives to maintain high academic standards in consonance with quantitative increase in the number of students being enrolled every year. It has an eagle eye for teaching and research.</p><p>  </p>'),(2,'Sri Venkateswara University','svu@ap.gov.in','http://svu.rnit.solutions.loc','456436463','public/universites/1480419531administrative_builtding_1599710706.jpg','svu','Thirupati','<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">Sri Venkateswara University</span>, Tirupati was established in 1954 in the world famous holy temple town of Tirupati. The university has the sprawling campus of 1000 acres with a panoramic and pleasant hill view.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">Since inception, the university has been lying more emphasis on teaching, research and extension activities in different subjects. The university offers undergraduate, postgraduate, professionals and research program. <a href=\"https://collegedunia.com/university/25379-sri-venkateswara-university-svu-tirupati/admission\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">Sri Venkateswara University admissions</a> are based on common entrance test SVUCET.</p><h3 style=\"font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(38, 38, 38); margin-top: 20px; margin-bottom: 10px; font-size: 16px !important;\"><span style=\"color: inherit; font-family: inherit;\">Sri Venkateswara University Highlights</span><br></h3><div class=\"cdcms_college_highlights\"><div class=\"table-responsive\" style=\"overflow-y: hidden; width: 921.75px;\"><table cellpadding=\"7\" cellspacing=\"0\" width=\"621\" style=\"border-spacing: 0px; background-color: transparent; border: none; font-size: 14px; width: 921px; font-weight: 600;\"><tbody style=\"color: rgb(76, 70, 70);\"><tr valign=\"top\"><td width=\"295\" style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249);\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"