s</p></td></tr></tbody></table></div></div><div class=\"cdcms_courses\"><h3 style=\"font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(38, 38, 38); margin-top: 20px; margin-bottom: 10px; font-size: 16px !important;\"><br></h3></div>','2020-09-02 20:24:25','2020-09-09 23:33:44','public/universites/14804195311443161485SVU_New_1599710685.jpg',NULL,'sdfsdf','<p helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\" style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38);\"><span style=\"font-weight: 700;\">Sri Venkateswara University</span>, Tirupati was established in 1954 in the world famous holy temple town of Tirupati. The university has the sprawling campus of 1000 acres with a panoramic and pleasant hill view.</p><p helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;\"=\"\" style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38);\">Since inception, the university has been lying more emphasis on teaching, research and extension activities in different subjects. The university offers undergraduate, postgraduate, professionals and research program.&nbsp;<a href=\"https://collegedunia.com/university/25379-sri-venkateswara-university-svu-tirupati/admission\" target=\"_blank\" style=\"color: rgb(66, 139, 202); background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sri Venkateswara University admissions</a>&nbsp;are based on common entrance test SVUCET.</p>'),(3,'Dr. NTR University of Health Sciences','ntruhs@ntruniversity.com','http://ntruhslearningsolutions.loc','+91 32423 34355','public/universites/14210508711_1599709995.jpg','NTRUHS','Vijayawada','<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">Dr. NTR University of Health Sciences (NTRUHS)</span> is a State University located in Vijayawada city of the Andhra Pradesh state. It offers graduate and postgraduate degrees, diploma and super specialty courses. In addition to UG and PG courses, the university also offers doctoral programs in both full-time and part-time mode. NTRUHS Admissions are granted on the basis of marks secured in the qualifying examination or the marks in the entrance exams such as NEET and AP EAMCET.</p><h2 style=\"font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(38, 38, 38); margin-top: 20px; margin-bottom: 10px; font-size: 18px !important;\"><span style=\"font-weight: 700;\">NTRUHS Highlights</span></h2><div class=\"table-responsive\" style=\"overflow-y: hidden; width: 921.75px; color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-spacing: 0px; background-color: transparent; border: none; width: 573px; font-weight: 600;\"><tbody style=\"color: rgb(76, 70, 70);\"><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 274px;\">Established | Type</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 298px;\">1986 | State University</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 274px;\">Formerly known as</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 298px;\">Andhra Pradesh University of Health Sciences</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 274px;\">Approved by</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 298px;\">UGC, MCI, INC, DCI</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 274px;\">Affiliated Colleges</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 298px;\">284</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 274px;\">Courses offered</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 298px;\">UG, PG, and Ph.D. (Total: 108)</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 274px;\">Admission Criteria</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); width: 298px;\">Entrance and Merit-based</td></tr><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 274px;\">Official Website</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 298px;\">http://ntruhs.ap.nic.in</td></tr></tbody></table></div><div class=\"cdcms_courses\" style=\"color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><h2 style=\"line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 18px !important;\"><br></h2></div>','2020-09-04 23:25:08','2020-09-09 23:34:21','public/universites/14210508716_1599710061.jpg','public/universites/uv25350_1599709995.jpg','NTRUHS','<span style=\"color: rgb(38, 38, 38); font-weight: 700;\">Dr. NTR University of Health Sciences (NTRUHS)</span><span style=\"color: rgb(38, 38, 38);\">&nbsp;is a State University located in Vijayawada city of the Andhra Pradesh state. It offers graduate and postgraduate degrees, diploma and super specialty courses. In addition to UG and PG courses, the university also offers doctoral programs in&nbsp;both full-time and part-time mode. NTRUHS Admissions&nbsp;are granted on the basis of marks secured in the qualifying examination or the marks in the entrance exams such as NEET&nbsp;and AP EAMCET.</span>'),(4,'Jawaharlal Nehru Technological University','jntuanthapur@ap.gov.in','http://jntu.rnit.solutions.loc','sadasd','public/universites/download (2)_1599364907.jpg','jntu','Ananthapur','<div class=\"cdcms_course_highlight\" style=\"color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><span style=\"font-weight: 700;\">Jawaharlal Nehru Technological University (JNTUA) </span>is a State University located in Anantapur, Andhra Pradesh. It was established in the year 2008. The University is recognized by University Grants Commission of India (UGC) and is spread across 200 acres of land. It offers various Undergraduate, Postgraduate and Research level courses in the field of Engineering and Management through its Constituent colleges and several affiliated & standalone colleges.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">The University has following Constituent Colleges and Department:</p><ul style=\"margin-bottom: 10px;\"><li><a href=\"https://collegedunia.com/college/57701-jntua-college-of-engineering-ananthapur\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">JNTUA College of Engineering, Ananthapuramu</a></li><li><a href=\"https://collegedunia.com/college/24119-jntua-college-of-engineering-jntucep-kadapa\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">JNTUA College of Engineering, Pulivendula</a></li><li><a href=\"https://collegedunia.com/college/58535-jntua-oil-technological-and-pharmaceutical-research-institute-otpri-ananthapur\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">Oil Technological Research Institute, Ananthapuramu</a></li><li>JNTUA College of Engineering, Kalikiri</li><li><a href=\"https://collegedunia.com/college/57707-jntua-department-of-management-studies-anantapur\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">JNTUA, Department of Management Studies</a></li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; background: rgb(238, 238, 238); border: 1px solid rgb(204, 204, 204); padding: 5px 10px;\"><span style=\"color: rgb(255, 160, 122);\"></span><span style=\"font-weight: 700;\"><span style=\"color: rgb(255, 0, 0);\">Latest!</span></span> <span style=\"color: rgb(255, 0, 0);\"></span>JNTUA has declared the result of B.Tech 1<span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">st</span> and 2<span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">nd</span> year for regular and supplementary examinations. Students appeared in the exams can check their results <a href=\"https://jntuaresults.ac.in/view-results-56736166.html\" rel=\"nofollow\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">here</a>. <br>The University conducts semester examinations in the month of November/December and May/June. Results are declared within 20-30 days after the results. Students must visit the official website on a regular basis to check the updates about the result. <span style=\"font-weight: 700;\"><span style=\"color: rgb(255, 0, 0);\">Know more </span></span><span style=\"color: rgb(255, 0, 0);\"></span><a href=\"https://collegedunia.com/news/c-54821-jntu-anantapur-jntua-result\" target=\"_blank\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(66, 139, 202);\">JNTUA Results</a></p><hr style=\"border-top-color: rgb(238, 238, 238); margin-top: 20px; margin-bottom: 20px;\"><h3 style=\"line-height: 1.1; margin-top: 20px; margin-bottom: 10px; font-size: 16px !important;\">JNTU Anantapur Highlights</h3><div class=\"table-responsive\" style=\"overflow-y: hidden; width: 921.75px;\"><table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-spacing: 0px; background-color: transparent; border: none; width: 500px; font-weight: 600;\"><tbody style=\"color: rgb(76, 70, 70);\"><tr><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 247px;\">Official Website</td><td style=\"padding: 12px; text-align: center; border: 1px solid rgb(221, 221, 221); background-color: rgb(249, 249, 249); width: 252px;\"><a href=\"https://www.jntua.ac.in/\" rel=\"nofollow\" target=\"_blank\" style=\"background-image: initial; background-