hrough its Constituent colleges and several affiliated &amp; standalone colleges.</span>'),(5,'Jawaharlal Nehru Technological University','jntuk@ap.gov.in','http://jntuk.rnit.solutions.loc','+91 2424 432234','public/universites/jawaharlal-nehru-technological-university-kakinada-2_1599364437.jpg','JNTUK','kakinada','<div class=\"cdcms_college_highlights\" style=\"color: rgb(38, 38, 38); font-family: din, \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\"><div class=\"cdcms_college_highlights\"><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Jawaharlal Nehru Technological University, Kakinada is a public university. This university at the time of its establishment in 1946 was known as The College of Engineering, Vizagapatnam. University College of Engineering, Kakinada was ranked 317 among universities by the National Institutional Ranking Framework (NIRF) in 2019. JNTUK has three constituent colleges:</p><ol style=\"margin-bottom: 10px;\"><li>University College of Engineering, Kakinada</li><li>University College of Engineering, Vizianagaram</li><li>University College of Engineering, Narasaraopet.</li></ol><div class=\"table-responsive\" style=\"overflow-y: hidden; width: 921.75px;\"><table class=\"table table-bordered\" style=\"border-spacing: 0px; width: 921px; max-width: 100%; margin-bottom: 20px; border-width: initial; border-style: none; font-weight: 600;\"><tbody style=\"color: rgb(76, 70, 70);\"><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Location</td><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857; background-color: rgb(249, 249, 249);\">Kakinada, East Godavri District, Andhra Pradesh</td></tr><tr><td style=\"padding: 8px; text-align: center; border-color: rgb(221, 221, 221); line-height: 1.42857;\">Year of Establishment</td><td style=\"padding: 8px; text-align: cente